import styled from 'styled-components'

export const Navbar = styled.nav`
  display: grid;
  grid-auto-flow: column;
  grid-gap: 1rem;
  align-items: center;
  justify-items: end;
  padding: 0 2rem;
  border-right: 1px dashed rgb(140, 145, 169);
`
